          placeholder="entrer votre emplacement"
          value={email}
          onChangeText={setEmail}
          style={styles.input}
        />
      </View>
      <View style={styles.buttonContainer}>
        <TouchableOpacity style={styles.button}>
          <AntDesign name="home" size={24} color="black" />
          <Text
            style={styles.buttonLabel}
            onPress={() => navigation.navigate("Home")}
          >
            Accueil
          </Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.button}>
          <AntDesign name="user" size={24} color="black" />
          <Text
            style={styles.buttonLabel}
            onPress={() => navigation.navigate("Users", { token })}
          >
            Utilisateurs
          </Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.button}
          onPress={() => navigation.navigate("Agencies", { token })}
        >
          <FontAwesome name="building" size={24} color="black" />
          <Text style={styles.buttonLabel}>Agences</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.button}
          onPress={() => navigation.navigate("Cars", { token })}
        >
          <MaterialIcons name="directions-car" size={24} color="black" />
          <Text style={styles.buttonLabel}>Voitures</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
  },
  content: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
  title: {
    fontSize: 20,
    fontWeight: "bold",
    marginBottom: 20,
  },
  buttonContainer: {
    flexDirection: "row",
    justifyContent: "space-around",
    alignItems: "center",
    paddingBottom: 20,
  },
  button: {
    alignItems: "center",
  },
  buttonLabel: {
    marginTop: 5,
    fontSize: 16,
  },
});

export default HomeScreen;
